import React from 'react';
import axios from 'axios'
let soldiers;
class Stable extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            kind: '',
            data: []
        };
    }
    componentDidMount(){
        axios
            .get('http://127.0.0.1:7001/soldier/all')
            .then(({ data })=> {
                this.setState({
                    kind: data.kind,
                    data: data.data.children
                });
            })
            .catch((err)=> {})
    }

    render() {

    }
}

export default Stable;
